        _start:
            ld r1,fib1      ;r1 = a
            ld r2,fib2      ;r2 = b
            ld r3,sum       ;
            ld r6,max        ;
        loop:
            add r4,r0,r1    ;c = a
            add r1,r1,r2    ;a = a+b
            add r2,r0,r4    ;b = c
            blt r6,r1,save   ;if max < a goto end 
            rem r5,r1,2     ;d = r1%2
            bnq r5,r0,next  ;if d != 0 goto next
            add r3,r3,r1    ;sum+=a
