            jmp loop
        save:
            sw sum,r3
            ld r2,answ
            beq r3,r2,print
            jmp end
        print:
            add r2,r0,success
        loop_print:
            ld r1,r2
            sw out,r1
            add r2,r2,1
            beq r1,r0,end
            jmp loop_print
        end:
            hlt
            input: |-
